window.bookSummaryJSON = "<p>As the cadets and squires graduate from the Windom military academy, the call to a Knight's Quest summons two of the students to embark on a journey to the city of oracles, Pythia. The world is changing, struggling to find hope in new leaders while ancient threats begin to stir and thrust the cadets' plans for the future in disarray. Loyalties are tested as cadets and squires traverse the far reaches of the Day, searching for meaning, to find their purpose in life, as they embark on truly an impossible quest....</p>"; 
